import React, { useState, useEffect } from 'react';
import '../styles/Calculator.css';

const Calculator: React.FC = () => {
    const [initialValue, setInitialValue] = useState<string>('');
    const [finalValue, setFinalValue] = useState<string>('');
    const [percentChange, setPercentChange] = useState<string>('0%');
    const [percentagePoints, setPercentagePoints] = useState<string>('0pp');
    const [xGrowth, setXGrowth] = useState<string>('0X');

    const calculateValues = () => {
        const initial = parseFloat(initialValue);
        const final = parseFloat(finalValue);

        if (!isNaN(initial) && !isNaN(final) && initial !== 0) {
            // Calculate percent change
            const change = ((final - initial) / initial) * 100;
            setPercentChange(`${change.toFixed(1)}%`);

            // Calculate percentage points
            const points = final - initial;
            setPercentagePoints(`${points.toFixed(1)}pp`);

            // Calculate X growth
            const growth = final / initial;
            setXGrowth(`${growth.toFixed(1)}X`);
        } else {
            setPercentChange('0%');
            setPercentagePoints('0pp');
            setXGrowth('0X');
        }
    };

    useEffect(() => {
        calculateValues();
    }, [initialValue, finalValue]);

    return (
        <div className="calculator-container">
            <div className="banner">
                <span>WE'RE LAUNCHING A MARKET RESEARCH TOOL FOR MARKETERS</span>
                <a href="#" className="learn-more">LEARN MORE</a>
            </div>

            <h1>Percent Change Calculator</h1>

            <p className="description">
                This tool helps marketers calculate percent change, percentage points, and X growth
                — and learn how to describe data correctly in marketing content.
            </p>

            <div className="input-container">
                <div className="input-group">
                    <label>INITIAL VALUE (%)</label>
                    <input
                        type="number"
                        value={initialValue}
                        onChange={(e) => setInitialValue(e.target.value)}
                        placeholder="Enter initial value"
                    />
                </div>

                <div className="input-group">
                    <label>FINAL VALUE (%)</label>
                    <input
                        type="number"
                        value={finalValue}
                        onChange={(e) => setFinalValue(e.target.value)}
                        placeholder="Enter final value"
                    />
                </div>
            </div>

            <div className="results-container">
                <div className="result-box">
                    <div className="result-label">
                        <span className="icon">↗</span>
                        PERCENT CHANGE
                    </div>
                    <div className="result-value">{percentChange}</div>
                </div>

                <div className="result-box">
                    <div className="result-label">
                        <span className="icon">↗</span>
                        PERCENTAGE POINTS
                    </div>
                    <div className="result-value">{percentagePoints}</div>
                </div>

                <div className="result-box">
                    <div className="result-label">
                        <span className="icon">↗</span>
                        X GROWTH
                    </div>
                    <div className="result-value">{xGrowth}</div>
                </div>
            </div>

            <div className="explanation">
                <h3>Percent change is the relative change from an initial value to a final value.</h3>
                <div className="example">
                    <h4>EXAMPLE</h4>
                    <p>Marketers using AI tools changed from 20% to 40% year over year. So, marketers using AI tools grew 100% year over year.</p>
                </div>
                <div className="formula">
                    <h4>FORMULA</h4>
                    <p>((final value - initial value) / initial value) X 100%</p>
                </div>
            </div>

            <footer>
                <p>Created by <a href="#">Datalily</a> – a women-owned content & research studio.</p>
            </footer>
        </div>
    );
};

export default Calculator;
